webpackJsonp([0xb4778521dabe6000],{"./node_modules/json-loader/index.js!./.cache/json/vim-vundle.json":function(t,e){t.exports={data:{markdownRemark:{html:"<h2>Vundle</h2>\n<p>Vundle is short for Vim bundle and is a Vim plugin manager.</p>\n<p>It allows you toâ€¦</p>\n<ul>\n<li>keep track of and configure your plugins right in the <code>~/.vimrc</code> (a <a href='https://stackoverflow.com/questions/164847/what-is-in-your-vimrc' target='_blank' rel='nofollow'>file</a> to customise vim)</li>\n<li>install configured plugins (a.k.a. scripts/bundle)</li>\n<li>update configured plugins</li>\n<li>search by name all available Vim scripts</li>\n<li>clean unused plugins up</li>\n<li>run the above actions in a single keypress with interactive mode</li>\n</ul>\n<p>To get started, follow <a href='https://github.com/VundleVim/Vundle.Vim#quick-start' target='_blank' rel='nofollow'>this guide</a>.</p>\n<p>Some useful plugins to get you started are :</p>\n<ul>\n<li><a href=\"https://github.com/scrooloose/nerdtree\">nerdtree</a> - File tree explorer</li>\n<li><a href=\"https://github.com/vim-syntastic/syntastic\">syntastic</a> or <a href=\"https://github.com/w0rp/ale\">ale</a> - Syntax checker / linter </li>\n<li><a href=\"https://github.com/majutsushi/tagbar\">tagbar</a> - Displays tags in a window</li>\n<li><a href=\"https://github.com/kien/ctrlp.vim\">ctrlp</a> - Fuzzy file, buffer, mru, tag, etc finder</li>\n<li><a href=\"https://github.com/airblade/vim-gitgutter\">gitgutter</a> - Shows a git diff in the gutter (sign column)</li>\n<li><a href=\"https://github.com/tpope/vim-fugitive\">fugitive</a> - Git wrapper</li>\n<li><a href=\"https://github.com/Raimondi/delimitMate\">delimitMate</a> - Insert mode auto-completion for quotes, parens, brackets, etc</li>\n<li><a href=\"https://github.com/tomtom/tcomment_vim\">tcomment</a> - Comment lines whatever the language</li>\n<li>and tons more !</li>\n</ul>\n<h4>More Information:</h4>\n<ul>\n<li><a href='https://github.com/VundleVim/Vundle.Vim' target='_blank' rel='nofollow'>Github Repository</a></li>\n</ul>",fields:{slug:"/vim/vundle/"},frontmatter:{title:"Vundle"}}},pathContext:{slug:"/vim/vundle/"}}}});
